module.exports = "<h1 id=\"babel-plugin-partial-application-middot-version-https-img-shields-io-npm-v-babel-plugin-partial-application-svg-style-flat-square-maxage-3600-https-www-npmjs-com-package-babel-plugin-partial-application-license-https-img-shields-io-npm-l-babel-plugin-partial-application-svg-style-flat-square-maxage-3600-https-www-npmjs-com-package-babel-plugin-partial-application-travis-ci-https-img-shields-io-travis-citycide-babel-plugin-partial-application-svg-style-flat-square-maxage-3600-https-travis-ci-org-citycide-babel-plugin-partial-application-lightscript-https-img-shields-io-badge-written-20in-lightscript-00a99d-svg-flat-square-http-www-lightscript-org-\">babel-plugin-partial-application &middot; <a href=\"https://www.npmjs.com/package/babel-plugin-partial-application\"><img src=\"https://img.shields.io/npm/v/babel-plugin-partial-application.svg?style=flat-square&amp;maxAge=3600\" alt=\"Version\"></a> <a href=\"https://www.npmjs.com/package/babel-plugin-partial-application\"><img src=\"https://img.shields.io/npm/l/babel-plugin-partial-application.svg?style=flat-square&amp;maxAge=3600\" alt=\"License\"></a> <a href=\"https://travis-ci.org/citycide/babel-plugin-partial-application\"><img src=\"https://img.shields.io/travis/citycide/babel-plugin-partial-application.svg?style=flat-square&amp;maxAge=3600\" alt=\"Travis CI\"></a> <a href=\"http://www.lightscript.org\"><img src=\"https://img.shields.io/badge/written%20in-lightscript-00a99d.svg?flat-square\" alt=\"LightScript\"></a></h1>\n<blockquote>\n<p>Partial application syntax for JavaScript, inspired by Scala&#39;s <code>_</code> &amp; Kotlin&#39;s <code>it</code>.</p>\n</blockquote>\n<ul>\n<li><a href=\"#overview\">overview</a></li>\n<li><a href=\"#installation\">installation</a></li>\n<li><a href=\"#examples\">examples &amp; features</a><ul>\n<li><a href=\"#basic-placeholders\">basic placeholders</a>: <code>add(1, _)</code></li>\n<li><a href=\"#spread-placeholders\">spread placeholders</a>: <code>Math.max(..._)</code></li>\n<li><a href=\"#lambda-parameters\">lambda parameters</a>: <code>people.map(_.name)</code></li>\n<li><a href=\"#object-placeholders\">object placeholders</a>: <code>_.hasOwnProperty(&#39;dapper&#39;)</code></li>\n<li><a href=\"#binary-expressions\">binary expressions</a>: <code>_ === &#39;awesome&#39;</code>, <code>_.getPower().level &gt; 9000</code></li>\n</ul>\n</li>\n<li><a href=\"#usage\">usage</a><ul>\n<li><a href=\"#babelrc\">babelrc</a></li>\n<li><a href=\"#babel-cli\">babel-cli</a></li>\n<li><a href=\"#babel-api\">babel-api</a></li>\n</ul>\n</li>\n<li><a href=\"#caveats--limitations\">caveats &amp; limitations</a></li>\n<li><a href=\"#comparison-to-libraries\">comparison to libraries</a></li>\n<li><a href=\"#see-also\">see also</a></li>\n<li><a href=\"#contributing\">contributing</a></li>\n<li><a href=\"#license\">license</a></li>\n</ul>\n<hr>\n<h2 id=\"overview\">overview</h2>\n<p>Use the <code>_</code> symbol ( or a custom identifier of your choosing ) as a placeholder\nto signal that a function call is partially applied, or that you&#39;ll provide the\nobject of a method call at a later time.</p>\n<p>So basically - the original code isn&#39;t actually called yet, but will return a new\nfunction receiving the arguments you signified as placeholders.</p>\n<p>You can provide one or several placeholders mixed in with the rest of the usual\narguments. Think of the values that aren&#39;t placeholders as being &quot;bound&quot;. Check\nout the <a href=\"#examples\">examples</a> section to see all the different ways this is useful.</p>\n<h2 id=\"installation\">installation</h2>\n<pre><code class=\"lang-console\">npm i --save-dev babel-plugin-partial-application\n</code></pre>\n<p>Make sure you also have Babel installed:</p>\n<pre><code class=\"lang-console\">npm i --save-dev babel-cli\n</code></pre>\n<h2 id=\"examples\">examples</h2>\n<h3 id=\"basic-placeholders\">basic placeholders</h3>\n<p>Transform this:</p>\n<pre><code class=\"lang-js\">function sumOfThreeNumbers (x, y, z) {\n  return x + y + z;\n}\n\nconst oneAndTwoPlusOther = sumOfThreeNumbers(1, 2, _);\n</code></pre>\n<p>... into this:</p>\n<pre><code class=\"lang-js\">function sumOfThreeNumbers (x, y, z) {\n  return x + y + z;\n}\n\nconst oneAndTwoPlusOther = _a =&gt; {\n  return sumOfThreeNumbers(1, 2, _a);\n};\n</code></pre>\n<p>It also works for method calls, where this:</p>\n<pre><code class=\"lang-js\">const hasOwn = {}.hasOwnProperty.call(_, _);\n</code></pre>\n<p>... becomes:</p>\n<pre><code class=\"lang-js\">const hasOwn = (_a4, _a5) =&gt; {\n  return {}.hasOwnProperty.call(_a4, _a5);\n};\n</code></pre>\n<h3 id=\"spread-placeholders\">spread placeholders</h3>\n<p>You can also use spread to represent multiple arguments:</p>\n<pre><code class=\"lang-js\">const maxOf = Math.max(..._)\n\nconsole.log(maxOf(1, 2, 3, 4, 5))\n// -&gt; 5\n</code></pre>\n<p>This is compiled to:</p>\n<pre><code class=\"lang-js\">const maxOf = (..._a) =&gt; {\n  return Math.max(..._a)\n}\n</code></pre>\n<blockquote>\n<p>If your target environment doesn&#39;t support rest / spread,\nyou&#39;ll have to transpile it separately as usual.</p>\n</blockquote>\n<h3 id=\"lambda-parameters\">lambda parameters</h3>\n<p>Easy shorthand for accessing properties or calling methods on the\napplied argument - useful in higher order functions like <code>Array#map()</code>:</p>\n<pre><code class=\"lang-js\">const people = [\n  { name: &#39;Jeff&#39; },\n  { name: &#39;Karen&#39; },\n  { name: &#39;Genevieve&#39; }\n]\n\nconsole.log(people.map(_.name))\n// -&gt; [&#39;Jeff&#39;, &#39;Karen&#39;, &#39;Genevieve&#39;]\n</code></pre>\n<p>... compiles to:</p>\n<pre><code class=\"lang-js\">console.log(people.map(_a =&gt; {\n  return _a.name\n}))\n</code></pre>\n<h3 id=\"object-placeholders\">object placeholders</h3>\n<blockquote>\n<p>also called &quot;lambda standalones&quot;... only by me though</p>\n</blockquote>\n<p>The placeholder can stand in for an object on which you&#39;ll access properties\nor call methods. This is very similar to <a href=\"#lambda-parameters\">lambda parameters</a>\nbut can be used outside function calls.</p>\n<p>As an example, we could re-implement the <code>hasOwn()</code> function from the\n<a href=\"#basic-placeholders\">basic placeholders section</a> like this (although\nwithout <code>.call()</code> this time):</p>\n<pre><code class=\"lang-js\">const hasOwn = _.hasOwnProperty(_)\n</code></pre>\n<p>... which compiles to:</p>\n<pre><code class=\"lang-js\">const hasOwn = (_a2, _a) =&gt; {\n  return _a2.hasOwnProperty(_a)\n};\n</code></pre>\n<p>The object that will replace the placeholder becomes the first argument to\nthe resulting function, so you&#39;d use it like this:</p>\n<pre><code class=\"lang-js\">const object = { flammable: true }\n\nhasOwn(object, &#39;flammable&#39;)\n// -&gt; true\n</code></pre>\n<h3 id=\"binary-expressions\">binary expressions</h3>\n<p>You can use placeholders within logical comparisons ( <code>===</code> ) or\naddition, subtraction, string concatenation, etc. So this:</p>\n<pre><code class=\"lang-js\">array.map(_ === true)\n</code></pre>\n<p>... transforms into this:</p>\n<pre><code class=\"lang-js\">array.map(_b =&gt; {\n  return _b === true\n})\n</code></pre>\n<p>And for a classic example, let&#39;s say you have an Array of numbers\nand want the total sum of them all:</p>\n<pre><code class=\"lang-js\">const array = [1, 2, 3, 4, 5]\narray.reduce(_ + _)\n// -&gt; 15\n</code></pre>\n<p>You can combine this with object placeholders and lambda parameters:</p>\n<pre><code class=\"lang-js\">const heroes = [\n  { getPower () { return { level: 9001 } } }\n  { getPower () { return { level: 4500 } } }\n]\n\nheroes.filter(_.getPower().level &gt; 9000)\n</code></pre>\n<h3 id=\"curried-style-functions\">curried-style functions</h3>\n<p>A handy usage for this plugin is emulating &quot;curried&quot; style functions,\nwhere a function returns another function that receives the data before\nfinally returning the result.</p>\n<p>While partial application <a href=\"http://www.2ality.com/2011/09/currying-vs-part-eval.html\">is a different thing</a>, it can accomplish\nthe same goals in a lot of situations. For example, this:</p>\n<pre><code class=\"lang-js\">import { map, get } from &#39;lodash&#39;\n\nconst mapper = map(_, get(_, &#39;nested.key&#39;, &#39;default&#39;))\n</code></pre>\n<p>... would compile to this:</p>\n<pre><code class=\"lang-js\">import { map, get } from &#39;lodash&#39;\n\nconst mapper = _a =&gt; {\n  return map(_a, _a2 =&gt; {\n    return get(_a2, &#39;nested.key&#39;, &#39;default&#39;)\n  })\n}\n</code></pre>\n<p>... to be used something like this:</p>\n<pre><code class=\"lang-js\">const array = [\n  { nested: { key: &#39;value&#39; } },\n  { nested: { something: &#39;&#39; } },\n  { nested: { key: &#39;things&#39; } }\n]\n\nconst newArray = mapper(array))\n// -&gt; [&#39;value&#39;, &#39;default&#39;, &#39;things&#39;]\n</code></pre>\n<h2 id=\"usage\">usage</h2>\n<h3 id=\"-babelrc\">.babelrc</h3>\n<pre><code class=\"lang-json\">{\n  &quot;presets&quot;: [],\n  &quot;plugins&quot;: [&quot;partial-application&quot;]\n}\n</code></pre>\n<p>Optionally configure the plugin by using an Array of <code>[pluginName, optionsObject]</code>.\nThis is the default configuration:</p>\n<pre><code class=\"lang-json\">{\n  &quot;presets&quot;: [],\n  &quot;plugins&quot;: [\n    [&quot;partial-application&quot;, {\n      &quot;placeholder&quot;: &quot;_&quot;,\n      &quot;useAlternatePlaceholder&quot;: false\n    }]\n  ]\n}\n</code></pre>\n<table>\n<thead>\n<tr>\n<th style=\"text-align:center\">property</th>\n<th style=\"text-align:center\">type</th>\n<th style=\"text-align:center\">default</th>\n<th>description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td style=\"text-align:center\"><code>placeholder</code></td>\n<td style=\"text-align:center\"><code>String</code></td>\n<td style=\"text-align:center\"><code>_</code></td>\n<td>Identifier used to signal partial application in function calls.</td>\n</tr>\n<tr>\n<td style=\"text-align:center\"><code>useAlternatePlaceholder</code></td>\n<td style=\"text-align:center\"><code>Boolean</code></td>\n<td style=\"text-align:center\"><code>false</code></td>\n<td>Use <code>__</code> as the placeholder. Ignored if <code>placeholder</code> is set to a custom value.</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"babel-cli\">Babel CLI</h3>\n<pre><code class=\"lang-console\">babel --plugins partial-application src.js\n</code></pre>\n<p>See Babel&#39;s <a href=\"http://babeljs.io/docs/usage/cli/\">CLI documentation</a> for more.</p>\n<h3 id=\"babel-api\">Babel API</h3>\n<pre><code class=\"lang-js\">require(&#39;babel-core&#39;).transform(&#39;code&#39;, {\n  presets: [],\n  plugins: [&#39;partial-application&#39;]\n});\n</code></pre>\n<h2 id=\"caveats-limitations\">caveats &amp; limitations</h2>\n<blockquote>\n<p><code>_</code> is a common variable name ( eg. for <a href=\"https://github.com/lodash/lodash\">lodash</a> )</p>\n</blockquote>\n<p>This is the most obvious potential pitfall when using this plugin. <code>_</code> is commonly\nused as the identifier for things like lodash&#39;s collection of utilities.</p>\n<p>This would be perfectly valid normally, but by default would cause an error\nwhen using this plugin:</p>\n<pre><code class=\"lang-js\">import _ from &#39;lodash&#39;\n\n// -&gt; SyntaxError: src.js: Cannot use placeholder as an identifier.\n</code></pre>\n<p>The reason this plugin uses <code>_</code> by default then is not to make your life harder.\nThere are a few reasons this is not seen as problematic.</p>\n<ol>\n<li><p><code>_</code> is a common symbol for partial application</p>\n<p>The Scala language uses the underscore as a placeholder for partially\napplied functions, and tons of JavaScript libraries have used it as\nwell - so it&#39;s become recognizable.</p>\n</li>\n<li><p>Monolithic builds of packages like lodash are on the way out</p>\n<p>lodash v5 will be getting rid of the monolithic build in favor\nof explicitly imported or &#39;cherry-picked&#39; utilities. So it will\nbecome less common to see the entirety of lodash imported,\nespecially with ES module tree-shaking on the horizon.</p>\n<p>On top of that, <a href=\"https://github.com/lodash/babel-plugin-lodash\">babel-plugin-lodash</a> still works\neffectively when you just import what you need like so:</p>\n<pre><code class=\"lang-js\">import { add } from &#39;lodash&#39;\n</code></pre>\n</li>\n<li><p>The plugin allows for custom placeholder symbols</p>\n<p>If you do happen to need <code>_</code> as an identifier, you&#39;re able to change\nthe placeholder to any string value you want. Right now this plugin\ndoesn&#39;t place limitations on that, although obvious keywords won&#39;t\nmake the cut beyond the plugin.</p>\n<p>You could use <code>$</code>, <code>it</code>, or even <code>PLACEHOLDER</code> - though I think you&#39;ll\nunderstand why the <code>_</code> is an appealing choice over the alternatives.</p>\n</li>\n<li><p>Partial application with <code>_</code> is damn cool</p>\n</li>\n</ol>\n<h2 id=\"comparison-to-libraries\">comparison to libraries</h2>\n<p>Lodash, Underscore, Ramda, and other libraries have provided partial application\nwith a helper function something like <code>_.partial(fn, _)</code> which wraps the provided\nfunction, and basically just takes advantage of the fact that <code>{} !== {}</code> to recognize\nthat the monolithic <code>_</code>, <code>_.partial.placeholder</code>, or Ramda&#39;s <code>R.__</code> is a specific\nobject deemed a placeholder.</p>\n<p>This Babel plugin gives you the same features at the syntax level. Or even better, like\n<a href=\"#lambda-parameters\">lambda parameters</a> and <a href=\"#object-placeholders\">object placeholders</a>,\neat your heart out lodash :wink:. And it all comes with no runtime overhead. If you don&#39;t\nuse placeholders your functions are unaffected. If you do, they&#39;re compiled away and turn\ninto regular functions that don&#39;t have to check arguments to see if a placeholder was provided.</p>\n<h2 id=\"see-also\">see also</h2>\n<ul>\n<li><a href=\"http://www.lightscript.org\">LightScript</a> - the compile-to-JS language this plugin is written in, leveraging <a href=\"https://babeljs.io\">Babel</a></li>\n<li><a href=\"https://github.com/lodash/lodash/wiki/FP-Guide\">lodash/fp</a> - functional adaptation of the great Lodash utility library</li>\n<li><a href=\"http://ramdajs.com/\">Ramda</a> - highly functional programming-oriented utility library</li>\n<li><a href=\"https://github.com/xtuc/babel-plugin-transform-scala-lambda\">babel-plugin-transform-scala-lambda</a> - a similar plugin for more limited Scala-like lambda syntax</li>\n</ul>\n<h2 id=\"contributing\">contributing</h2>\n<p>Pull requests and any <a href=\"https://github.com/citycide/babel-plugin-partial-application/issues\">issues</a>\nfound are always welcome.</p>\n<ol>\n<li>Fork the project, and preferably create a branch named something like <code>feat-make-better</code></li>\n<li>Modify as needed, <code>src/index.lsc</code> being the source file</li>\n<li>Make sure all tests continue to pass, and it never hurts to have more tests</li>\n<li>Push &amp; pull request! :tada:</li>\n</ol>\n<h2 id=\"license\">license</h2>\n<p>MIT  <a href=\"https://github.com/citycide\">Bo Lingen / citycide</a></p>\n";

